syntax = "proto3";

option java_package = "com.iquantex.ts.cre.data.process.message.protobuf";

option java_outer_classname = "REDataRegion";

// 地域信息
message RegionInfo {
    string code = 1;

    string parentCode = 2;

    string level = 3;

    string cname = 4;

    string csname = 5;

    string ename = 6;

    string esname = 7;
}
